// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwLayoutSlot from 'viewmodel/AwLayoutSlotViewModel';
import AwInContentSearchBox from 'viewmodel/AwInContentSearchBoxViewModel';
import AwPwaInclude from 'viewmodel/AwPwaIncludeViewModel';
import { ExistWhen } from 'js/hocCollection';
const DivExistWhen = ExistWhen('div');



/*
ctx imports
*/
import { getContext as context } from 'js/AwPrimaryWorkareaService';
const ctxImportObj = { context };


/*
dynamic import
 */
registerDynImportEntry('js/AwPrimaryWorkareaService', () => import('js/AwPrimaryWorkareaService'));
registerDynImportEntry('js/appCtxService', () => import('js/appCtxService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "searchBox": {
            "displayName": "",
            "type": "STRING",
            "isRequired": "true",
            "dbValue": "",
            "dispValue": ""
        },
        "selectionData": {
            "initialValues": {},
            "meta": {}
        }
    },
    "ctx": {
        "context": {
            "parser": {
                "method": "getContext",
                "deps": "js/AwPrimaryWorkareaService"
            }
        }
    },
    "actions": {
        "reset": {
            "actionType": "JSFunction",
            "method": "reset",
            "inputData": {
                "selectionModel": "{{props.selectionModel}}"
            },
            "deps": "js/AwPrimaryWorkareaService"
        },
        "handleSelectEvent": {
            "actionType": "JSFunction",
            "method": "handleSelectEvent",
            "inputData": {
                "eventData": "{{parameters.eventData}}",
                "pwaSelectionModel": "{{props.selectionModel}}"
            },
            "deps": "js/AwPrimaryWorkareaService"
        },
        "handleMultiSelectEvent": {
            "actionType": "JSFunction",
            "method": "handleMultiSelectEvent",
            "inputData": {
                "eventData": "{{parameters.eventData}}",
                "pwaSelectionModel": "{{props.selectionModel}}"
            },
            "outputData": {
                "showCheckBox": ""
            },
            "deps": "js/AwPrimaryWorkareaService"
        },
        "handleSelectionChange": {
            "actionType": "JSFunction",
            "method": "handleSelectionChange",
            "inputData": {
                "localSelectionData": "{{data.selectionData}}",
                "parentSelectionData": "{{props.selectionData}}",
                "selModel": "{{props.selectionModel}}"
            },
            "deps": "js/AwPrimaryWorkareaService"
        },
        "unRegisterPwaSelectionInfoContext": {
            "actionType": "JSFunction",
            "method": "unRegisterCtx",
            "inputData": {
                "name": "pwaSelectionInfo"
            },
            "deps": "js/appCtxService"
        }
    },
    "lifecycleHooks": {
        "onUpdate": [
            {
                "action": "handleSelectionChange",
                "observers": [
                    "viewModel.atomicData.selectionData"
                ]
            }
        ],
        "onUnmount": "unRegisterPwaSelectionInfoContext"
    },
    "onEvent": [
        {
            "eventId": "primaryWorkarea.reset",
            "action": "reset"
        },
        {
            "eventId": "primaryWorkarea.selectAction",
            "action": "handleSelectEvent",
            "inputArgs": {
                "eventData": "{{eventData}}"
            }
        },
        {
            "eventId": "primaryWorkarea.multiSelectAction",
            "action": "handleMultiSelectEvent",
            "inputArgs": {
                "eventData": "{{eventData}}"
            }
        }
    ],
    "props": {
        "view-base": {
            "type": "object"
        },
        "view": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "selection-model": {
            "type": "object"
        },
        "search-box": {
            "type": "object"
        },
        "search-state": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        }
    },
    "_viewModelId": "AwStandardPrimaryWorkarea",
    "_uniqueViewModelId": "AwStandardPrimaryWorkarea"
};

/*
<div class='sw-column w-12 h-12 afx-alt-content-background'>
    <div class='aw-layout-workareaCommandbar aw-theme-toolbar'>
        <aw-layout-slot name='aw_pwaCommandBar'
            context="{...props.subPanelContext,selectionModel:props.selectionModel,pwaSelectionModel:props.selectionModel,searchState: props.searchState,selectionData:data.selectionData}">
        </aw-layout-slot>
    </div>
    <div exist-when="!subPanelContext.context.search.hideInContentSearchBox" class='aw-search-inContentSearchBox'>
        <aw-in-content-search-box class='aw-search-searchBox' prop="data.searchBox" search-state="props.searchState">
        </aw-in-content-search-box>
    </div>
    <div class='sw-row sw-primary-workarea align-self-stretch flex-auto'>
        <aw-pwa-include view-base="props.viewBase" view="props.view"
            sub-panel-context='props.ctx.context[0]'
            show-check-box="data.showCheckBox" selection="props.selectionModel" selection-data="data.selectionData">
        </aw-pwa-include>
    </div>
</div>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="sw-column w-12 h-12 afx-alt-content-background">
        <div className="aw-layout-workareaCommandbar aw-theme-toolbar">
            <AwLayoutSlot name="aw_pwaCommandBar" context={AwParseService.instance( "{...props.subPanelContext,selectionModel:props.selectionModel,pwaSelectionModel:props.selectionModel,searchState: props.searchState,selectionData:fields.selectionData}" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwLayoutSlot>
        </div>
        <DivExistWhen className="aw-search-inContentSearchBox" existWhen={AwParseService.instance( "!subPanelContext.context.search.hideInContentSearchBox" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            <AwInContentSearchBox className="aw-search-searchBox" {...getField("data.searchBox", fields, $index, null, null )} searchState={AwParseService.instance( "props.searchState" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwInContentSearchBox>
        </DivExistWhen>
        <div className="sw-row sw-primary-workarea align-self-stretch flex-auto">
            <AwPwaInclude viewBase={AwParseService.instance( "props.viewBase" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} view={AwParseService.instance( "props.view" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} subPanelContext={AwParseService.instance( "props.ctx.context[0]" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} showCheckBox={AwParseService.instance( "data.showCheckBox" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selection={AwParseService.instance( "props.selectionModel" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} selectionData={AwParseService.instance( "fields.selectionData" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwPwaInclude>
        </div>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
